import { HttpParams } from '@angular/common/http';
import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';


@Component({
  selector: 'app-missiondetails',
  templateUrl: './missiondetails.component.html',
  styleUrls: ['./missiondetails.component.css']
})

export class MissiondetailsComponent {
  constructor (
    private route: ActivatedRoute,
    private httpclient: HttpClient
  ) {}

  ngOnInit(): void {
    const flightNumber = this.route.snapshot.paramMap.get('flight_number');
    let searchParam = new HttpParams().set("flight_number",flightNumber);
    this.httpclient.get("https://api.spacexdata.com/v3/launches", searchParam)
    this.missionService.getMissionByFlightNumber(flightNumber).subscribe(
      (mission) => {
        this.mission = mission;
      },
      (error) => {
        console.log(error);
      }
    );
  }
}
